Landauer  &quot;Woodworking: The Complete Step-by-step Guide &quot;
Landauer Publishing | 2009 | ISBN: 189062179X | 448 pages | Djvu 

This is a comprehensive and easy-to-follow guide to the essentials of woodworking. From setting up a workshop to sophisticated joints, this superbly illustrated guide offers readers expert advice on everything they need to know to become a master woodworker. &quot;Woodworking&quot; includes detailed information on: choosing the most suitable timber for your project; how to measure, mark and layout your wood; cutting, drilling, shaping; clamping, gluing, fastening, finishing; and much, much more! This volume also includes more than 40 home furnishing and accessory projects to help you practice and perfect your new found skills.
